import React from 'react'
import Navbar from '../Components/Navbar/Navbar'
import "./home.scss"

const Home = () => {
  return (
    <div className='home'>

     <Navbar/>
     <img height={700} src="https://t3.ftcdn.net/jpg/01/41/48/32/240_F_141483279_Ed0Wx0LF9tfF7zGVRYG7Kv5fL0suXYEb.jpg" alt="" />
     <Li/>
    </div>
  )
}

export default Home
